    super();

    this.state = {
      monster1: {
        name: "Linda",
      },
      monster2: {
        name: "Frank",
      },
      monster3: {
        name: "Jackie",
      },
    };
  }

  render() {
    return (
      <div className="App">
        {console.log(this.state)}
